import React from "react";
import './tailwind.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'; // Use BrowserRouter for the main router
import MyProvider from "./context/Myprovider";
import { Signup } from "./components/Signup-Login";

function App() {
  return (
    <Router>  {/* The Router should be at the top level */}
      <MyProvider>  {/* Your provider can be inside the Router */}
        <Routes>
          <Route path="/" element={<Signup />} />
        </Routes>
      </MyProvider>
    </Router>
  );
}

export default App;
